script: |
  super -f text -I q1534.spq | sort > q1534.out

inputs:
  - name: q1534.spq
    data: |
      SELECT DISTINCT - 12 * + col0 * - col1 * + + col2 / col1 * + + ( 13 ) AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( NULL ) BETWEEN col2 AND + ( + col1 );
  - name: tab1

outputs:
  - name: q1534.out
    data: |
